import React from 'react'

const Navbar = () => {

    return (
        <nav className='navigate'>
            <div className='ref'> <a href='#'>Profile</a></div>
            <div className='ref'> <a href='#'>Messages</a></div>
            <div className='ref'> <a href='#'>News</a></div>
            <div className='ref'> <a href='#'>Music</a></div>
            <div className='ref'> <a href='#'>Settings</a></div>
        </nav>
    )
}
export default Navbar
